import { useHistory } from "react-router-dom";
import Cookies from "js-cookie";
const jwt = require("jsonwebtoken");

let cookie_parse = null;

const Profile = () => {
  const history = useHistory();
  var cookie_get = Cookies.get("jwt");
  if (!cookie_get) {
    history.push("/home");
  } else {
    cookie_parse = jwt.verify(
      cookie_get,
      "%$iwudibdiiwd@#$wdjdwnomdw(*&whdwhd#$>idnw(*&^"
    );
  }
  return (
    <div className="user-profile">
      <img src="https://cdn.shoplightspeed.com/shops/635857/files/27372479/1652x1652x2/madshus-madshus-endurance-skate-boot.jpg"></img>
      <h2>Username : {cookie_parse.username}</h2>
      <h2>Name : {cookie_parse.name}</h2>
      <h2>Mail-ID : {cookie_parse.mail}</h2>
    </div>
  );
};

export default Profile;
